CREATE TABLE SchoolName (
    id INTEGER PRIMARY KEY,                -- 学校 ID
    name TEXT NOT NULL                     -- 学校名称
);

CREATE TABLE CollegeName (
    id INTEGER PRIMARY KEY,                -- 学院 ID
    name TEXT NOT NULL                     -- 学院名称
);

CREATE TABLE MajorName (
    id INTEGER PRIMARY KEY,                -- 专业 ID
    name TEXT NOT NULL                     -- 专业名称
);

CREATE TABLE CM (                          -- CM 关系表
    college_id INTEGER NOT NULL,           -- 学院 ID
    major_id INTEGER PRIMARY KEY,          -- 专业 ID
    FOREIGN KEY (college_id) REFERENCES CollegeName(id),
    FOREIGN KEY (major_id) REFERENCES MajorName(id)
);

CREATE TABLE University (                  -- 相当于 SC 关系表
    id INTEGER PRIMARY KEY AUTOINCREMENT,  -- 自动生成的主键
    school_id INTEGER NOT NULL,            -- 学校 ID
    college_id INTEGER NOT NULL,           -- 学院 ID
    principal_id TEXT NOT NULL,            -- 校长身份证号码
    dean_id TEXT NOT NULL,                 -- 学院院长身份证号码
    FOREIGN KEY (school_id) REFERENCES SchoolName(id),
    FOREIGN KEY (college_id) REFERENCES CollegeName(id),
    FOREIGN KEY (principal_id) REFERENCES SchoolStaff(id_number),
    FOREIGN KEY (dean_id) REFERENCES SchoolStaff(id_number)
);

CREATE TABLE Student (
    id INTEGER PRIMARY KEY AUTOINCREMENT,  -- 自动生成的主键
    id_number TEXT NOT NULL UNIQUE,        -- 身份证号码
    name TEXT NOT NULL,                    -- 姓名
    gender TEXT NOT NULL,                  -- 性别
    age INTEGER NOT NULL,                  -- 年龄
    contact_info TEXT NOT NULL,            -- 联系方式
    student_id TEXT NOT NULL UNIQUE,       -- 学生号
    university_id INTEGER NOT NULL,        -- 学校 ID
    college_id INTEGER NOT NULL,           -- 学院 ID
    major_id INTEGER NOT NULL,             -- 专业 ID
    FOREIGN KEY (university_id) REFERENCES SchoolName(id),
    FOREIGN KEY (college_id) REFERENCES CollegeName(id),
    FOREIGN KEY (major_id) REFERENCES MajorName(id)
);

CREATE TABLE SchoolStaff (
    id INTEGER PRIMARY KEY AUTOINCREMENT,  -- 自动生成的主键
    id_number TEXT NOT NULL UNIQUE,        -- 身份证号码
    name TEXT NOT NULL,                    -- 姓名
    gender TEXT NOT NULL,                  -- 性别
    age INTEGER NOT NULL,                  -- 年龄
    contact_info TEXT NOT NULL             -- 联系方式
);

