SELECT 
    University.school_id,                                         -- 学校 ID
    SchoolName.name AS school_name,                               -- 学校名称
    University.college_id AS college_id,                          -- 学院 ID
    CM.major_id AS major_id,                                      -- 专业 ID
    SchoolStaff_Principal.id_number AS principal_id_number,       -- 校长身份证号码
    SchoolStaff_Principal.name AS principal_name,                 -- 校长姓名
    SchoolStaff_Principal.gender AS principal_gender,             -- 校长性别
    SchoolStaff_Principal.age AS principal_age,                   -- 校长年龄
    SchoolStaff_Principal.contact_info AS principal_contact_info, -- 校长联系方式
    SchoolStaff_Dean.id_number AS dean_id_number,                 -- 院长身份证号码
    SchoolStaff_Dean.name AS dean_name,                           -- 院长姓名
    SchoolStaff_Dean.gender AS dean_gender,                       -- 院长性别
    SchoolStaff_Dean.age AS dean_age,                             -- 院长年龄
    SchoolStaff_Dean.contact_info AS dean_contact_info            -- 院长联系方式
FROM 
    University
JOIN 
    SchoolName ON University.school_id = SchoolName.id            -- 关联学校名称
JOIN 
    CollegeName ON University.college_id = CollegeName.id         -- 关联学院名称
JOIN 
    SchoolStaff AS SchoolStaff_Principal ON University.principal_id = SchoolStaff_Principal.id_number  -- 关联校长信息
JOIN 
    SchoolStaff AS SchoolStaff_Dean ON University.dean_id = SchoolStaff_Dean.id_number                 -- 关联院长信息
JOIN
    CM ON University.college_id = CM.college_id                   -- 关联学院——专业映射
JOIN
    MajorName ON CM.major_id = MajorName.id                       -- 关联专业名称
ORDER BY 
    University.school_id;                                         -- 以学校排序（确保同一个学校的信息能连续）

